  false,\n\t\"url\": null,\n\t\"notes\": \"Relational data table for SCUBA diving
  surveys on the bank of the Northwestern Hawaiian Islands, which were published in
  a manuscript named in the title above. These data and other SCUBA surveys of the
  atoll of French Frigate Shoals (FFS) and its mesophotic slopes were used in the
  FFS monk seal Ecopath analysis. Also included is a sand trawl data set that was
  used to describe the fish community living in sand fields on the slope.\",\n\t\"license_title\":
